import React from "react";
import "./users.css";
import { DataGrid } from "@mui/x-data-grid";

const columns = [
  { field: "id", headerName: "ID", width: 60 },
  {
    field: "user",
    headerName: "username",
    width: 160,
    renderCell: (params) => {
      return (
        <div className="userList">
          <img src={params.row.Avatar} alt="" />
        </div>
      );
    },
  },
  { field: "email", headerName: "Email", width: 200 },
  {
    field: "status",
    headerName: "Status",
    width: 120,
  },
  {
    field: "transaction",
    headerName: "transaction",
    width: 140,
  },
];

const rows = [
  {
    id: 1,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$120.00",
  },
  {
    id: 2,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$200.00",
  },
  {
    id: 3,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$170.00",
  },
  {
    id: 4,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$250.00",
  },
  {
    id: 5,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$100.00",
  },
  {
    id: 6,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$300.00",
  },
  {
    id: 7,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$380.00",
  },
];

export default function DataTable() {
  return (
    <div style={{ height: 500, width: "100%" }}>
      <DataGrid
        rows={rows}
        columns={columns}
        pageSize={9}
        rowsPerPageOptions={[5]}
        checkboxSelection
      />
    </div>
  );
}
